import React from "react";
import {
  BannerWrap,
  BannerLeft,
  BannerRight,
  MainText,
  ReasonTitle,
  TerminText
} from "../styles/MapContainer";
import MapComponent from "../components/MapComponent";

function MapContainer() {
  return (
    <BannerWrap>
      <BannerLeft>
        <ReasonTitle>Локација</ReasonTitle>
        <MainText>Николе Пашића 20 34220 Лапово</MainText>
        <MapComponent />
      </BannerLeft>
      <BannerRight>
        <ReasonTitle>Слободни термини</ReasonTitle>
        <TerminText>

            Зашто је за младе људе, оне које тек чека живот, да развију таленат
            за музику и сутрадан прерасте у јаку и задовољну личност?

        </TerminText>
      </BannerRight>
    </BannerWrap>
  );
}

export default MapContainer;
